"use strict";
const url = require("../shared/url.js"),
  api = require("./api.js");
/**
 * # Получение своего ника
 * Не документированное
 *
 * @export
 * @class WalletNicknameApi
 * @extends {WalletApi}
 */
class WalletNicknameApi extends api.WalletApi {
  /**
   * ## Получение своего ника
   *
   * **Этот метод требует наличия валидного `walletId` (номера телефона привязанного к кошельку) в конфигурации API.**
   *
   * @return {Promise<NicknameData>} Promise<NicknameData>
   * @memberof WalletNicknameApi
   */
  async getCurrent() {
    return await this.http.get(
      url.url`qw-nicknames/v1/persons/${this.walletId}/nickname`()
    );
  }
}
exports.WalletNicknameApi = WalletNicknameApi;
